gather()

```r
library(tidyverse)
```


```r
wide &lt;- tibble(
  type = c("a", "b"), 
  yr_2017 = c(1, 1), 
  yr_2018=c(1.2, 1.5), 
  yr_2019=c(1.2, 1.3))
```

---


```r
wide %&gt;% gather(key=year, value=price, -type) %&gt;% 
  separate(year, into=c("item", "year"), sep="_")
```

```
# A tibble: 6 x 4
  type  item  year  price
  &lt;chr&gt; &lt;chr&gt; &lt;chr&gt; &lt;dbl&gt;
1 a     yr    2017    1  
2 b     yr    2017    1  
3 a     yr    2018    1.2
4 b     yr    2018    1.5
5 a     yr    2019    1.2
6 b     yr    2019    1.3
```

---


```r
long &lt;- wide %&gt;% gather(key=year, value=price, -type) %&gt;% 
  separate(year, into=c(NA, "year"), convert = TRUE)
long
```

```
# A tibble: 6 x 3
  type   year price
  &lt;chr&gt; &lt;int&gt; &lt;dbl&gt;
1 a      2017   1  
2 b      2017   1  
3 a      2018   1.2
4 b      2018   1.5
5 a      2019   1.2
6 b      2019   1.3
```

### UK housing data

.small[
1. Go to [UK Office for National Statistics](https://www.ons.gov.uk/) (Google it.)

1. Click People, population and community - Housing.

1. Scroll down the web-page to a sub-header called "Datasets related to housing"

1. Click on the second listed data-set called "Residential property sales for administrative geographies: HPSSA dataset 6"

1. Go to "Your download option - current" and click 'xls (2.0 MB)'

1. Move the downloaded xls file into 'C407/Data' folder.

1. Browse data using MS-Excel.
]

.small[

```r
wide_1a &lt;- readxl::read_excel(
  "Data/hpssadataset6numofresidentialpropertysalesforadmingeos.xls", 
  sheet = "1a", skip = 6)

---

Go to the [Census Profile, 2016 Census website](https://www12.statcan.gc.ca/census-recensement/2016/dp-pd/prof/index.cfm?Lang=E).

Click View 'Canada' in the Browse box.

You can see all the list of variables available for the whole Canada.

The same set of variables are available for smaller geographic units such as CMA or Census tracts.

---

Suppose we are interested in the percentage of young people in 20s among whole population.

Identify the Characteristic labels from the table at the website.

Find the corresponding member IDs.


```r
members %&gt;% View
```

We need Member ID = 8, 15, and 16.

---


```r
young &lt;- profile %&gt;% 
  filter(`Member ID: Profile of Census Metropolitan Areas/Census Agglomerations (2247)` %in% c(8, 15, 16))
```


```r
young %&gt;% View
```
